import React, { Component } from 'react';
import {
    OwpButton,
    OwpSearchDateTimePickerMulti,
    OwpPageCarded,
    OwpSearchHeader,
    OwpSearchSelectField,
    OwpSearchTextField,
    OwpToolbar,
    OwpTreeGrid,
    OwpSearchAutoComplete,
    OwpDateTimePicker,
} from 'owp/wrapper';
import * as TGEvent from 'owp/TGEvent';
import Pop_C0805001 from '../../include/Pop_C0805001';
// import Pop_C0802002 from '../../include/Pop_C0802002';

class Page extends Component {
    constructor(props) {
        super(props);
        this.state = {};
    }


    render() {
        return (
            <React.Fragment>
                <OwpPageCarded
                    header={
                        <OwpSearchHeader url="listOwpProdplan" className="pd0">
                            <div className="w-full">
                                <div className="flex mb-16">
                                    <OwpSearchDateTimePickerMulti
                                        name="sm02"
                                        initNow={true} // TODO: true 인 경우 현재 시로 init (* default = false)
                                        labels={{ start: ' 시작일', end: '종료일' }}
                                        inputProps={{ start: { style: { width: 140 } }, end: { style: { width: 140 } } }}
                                        required={true}
                                    />
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm01'}
                                        name={'sm01'}
                                        label={'품명'}
                                        
                                    />
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm01'}
                                        name={'sm01'}
                                        label={'규격'}
                                        
                                    />
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm01'}
                                        name={'sm01'}
                                        label={'재질 및 모델명'}
                                        
                                    />
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm01'}
                                        name={'sm01'}
                                        label={'Maker P/N'}
                                        
                                    />
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm01'}
                                        name={'sm01'}
                                        label={'설비명(Tag No.)'}
                                        
                                    />
                                </div>
                                <div className="flex">
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm01'}
                                        name={'sm01'}
                                        label={'제조사/공급사'}
                                        
                                    />
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm01'}
                                        name={'sm01'}
                                        label={'우선순위'}
                                        
                                    />
                                    <OwpSearchSelectField
                                        className="w-160"
                                        id={'sm05'}
                                        name={'sm05'}
                                        label="보관 장소"
                                        options={[
                                            { label: 'R-1', value: '1' },
                                            { label: 'R-2', value: '2' },
                                        ]}
                                        value={'1'}
                                    />
                                    <OwpDateTimePicker
                                        initNow
                                        label="납기"
                                        inputProps={{ style: { width: 150 } }}
                                    />
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm01'}
                                        name={'sm01'}
                                        label={'Maker P/N'}
                                        
                                    />
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm01'}
                                        name={'sm01'}
                                        label={'우선순위'}
                                        
                                    />
                                </div>
                            </div>
                        </OwpSearchHeader>
                    }
                    contentToolbar={
                        <OwpToolbar title="부품/소무품">
                            <Pop_C0805001/>
                            <OwpButton color={'secondary'} variant={'contained'}>
                            수정
                            </OwpButton>
                            <OwpButton color={'secondary'} variant={'contained'}>
                            삭제
                            </OwpButton>
                        </OwpToolbar>
                    }
                    content={
                        <React.Fragment>
                            <OwpTreeGrid
                                id="C0805001"
                                LayoutUrl={'/assets/data/C0805001Def.xml'}
                                DataUrl={'/assets/data/C0202000Data.xml'}
                            />
                        </React.Fragment>
                    }
                    innerScroll
                />
            </React.Fragment>
        );
    }
}

export default Page;
